    super();
    this.state = {
      string: 'Hello Quan'
    }
  }
  render() {
    return(<div className="App_1">
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <p>
        Hello Quan
      </p>
      <button>Change Text</button>
    </header>
  </div>);
  };
}

export default Bpp;
